const router = createBrowserRouter([
    {
            path: "/",
            element: [<Header />, <AppContainer />, <Footer />],
            children: [
                {
                    path: '/',
                    element: <App />,
                    children: [
                        {
                            //Homepage
                            path: "/",
                            element: <Homepage />
                        },
                        {
                            //About
                            path: "/about",
                            element: <About />
                        },
                        {
                            //ProductPage
                            path: "/product",
                            element: <ProductPage />
                        },
                        {
                            //List products by category
                            path: "/product-filter",
                            element: <ProductSection />
                        },
                        {
                            //Cart manage
                            path: "/cart-manage",
                            element: <CartManage />
                        },
                        {
                            //Blog
                            path: "/blog",
                            element: <Blog />
                        },
                        {
                            //Login
                            path: "/",
                            element: <Login />,
                            children: [
                                {
                                    //LoginForm
                                    path: '/login',
                                    element: <LoginForm />
                                },
                                {
                                    //SignupForm
                                    path: '/signup',
                                    element: <SignupForm />
                                }
                            ]
                        }
                    ]
                },
                {
                    //Admin Dashboard
                    path: '/admin-dashboard',
                    element: <Protected>
                                <Dashboard />
                            </Protected>
                }
            ]
        }
    ])
export default router
